    const {name, description, url, source } = props.info;
return(
 <div className="list-item">
     <a href={url} target="_blank" className="list-group-item">
         {name.text}
     </a>
     <p>
         {description.text}
     </p>
     <p>
         {source.text}
     </p>
 </div>
)
}
export default Evento;
